import React from 'react';

const Navigation = () => {
    return (
        <div className="sidebar">
            <div className="id">
                <div className="idContent">
                    <img src="./media/billgates.jpg" alt="profil-picture" />
                    <h3>Amadou Dioulde BA</h3>
                </div>
            </div>

        </div>
    );
};

export default Navigation;
